import React, { useEffect } from "react";
import Images2016 from "./Images2016";
import { Route, Link } from "react-router-dom";

export default function Routes2016() {
  //   useEffect(() => {
  //     window.addEventListener("keydown", handleArrow);

  //     return () => {
  //       window.removeEventListener("keydown", handleArrow);
  //     };
  //   }, []);

  function handleArrow(event: any) {
    console.log("here");
    if (event.keyCode == 39) {
      console.log("right");
    } else if (event.keyCode == 37) {
      console.log("left");
    }
  }
  let routes = Images2016.map((image, index, Images2016) => {
    let leftButton;
    let rightButton;
    if (index === 0) {
      rightButton = (
        <Link to={"/feed" + Images2016[index + 1].src}>
          <i className="fas fa-chevron-right pl-4"></i>
        </Link>
      );
    } else if (index === Images2016.length - 1) {
      leftButton = (
        <Link to={"/feed" + Images2016[index - 1].src}>
          <i className="fas fa-chevron-left pr-4"></i>
        </Link>
      );
    } else {
      leftButton = (
        <Link to={"/feed" + Images2016[index - 1].src}>
          <i className="fas fa-chevron-left pr-4"></i>
        </Link>
      );
      rightButton = (
        <Link
          to={"/feed" + Images2016[index + 1].src}
          style={{ color: "black" }}
        >
          <i className="fas fa-chevron-right pl-4"></i>
        </Link>
      );
    }

    return (
      <Route exact path={"/feed" + image.src}>
        <div>
          <i className="fas fa-times"></i>
          <div className="d-flex align-items-center justify-content-center">
            {leftButton}
            <div className="d-flex justify-content-center mt-4">
              <img
                className="img-fluid"
                src={image.src}
                alt={image.title}
                style={{
                  maxHeight: "92vh",
                  objectFit: "contain",
                }}
              ></img>
            </div>
            {rightButton}
          </div>
        </div>
      </Route>
    );
  });
  return routes;
}
